window.bookSummaryJSON = "<p>In the modern world, qi is money.</p> <p>The days of traveling martial artists and mountaintop masters are over. Power is controlled by corporations, modernized martial arts sects, and governments. Those at the bottom of society struggle as second-class citizens in a world in which power is a commodity.</p> <p>Rick has attempted to separate himself from the world of cutthroat killers but is drawn in by a chance to participate in a contest at the highest levels. The resulting trials will take him across the world against many different opponents, but he knows that his sponsors ultimately just want to use him for their own profit. In the end, he'll need to decide what it is that he really wants....</p>"; 
